function httpGet(url) {
    return fetch(url, {
        method: "get",
        headers: {
            "Content-Type": "application/json",
            "X-Requested-With": "XMLHttpRequest",
            "Access-Control-Allow-Origin": "*",
        },
    }).then(data => {
        if (DEBUG_LOG_ENABLED) {
            console.table(data);
        }

        return data.json();
    }).catch(error => {
        return JSON.parse(testJson)
    });
}

function createTeamBox(img, teamName, isReversed) {
    let teamBox = document.createElement("div");

    let img1 = document.createElement('img');
    img1.id = "team1-icon"
    img1.width = 24;
    img1.src = img;

    let matchText = document.createElement("span")
    matchText.id = "team-name"
    matchText.appendChild(document.createTextNode(teamName))

    if (isReversed) {
        teamBox.appendChild(matchText)
        teamBox.appendChild(img1);
        teamBox.classList.add("right-box")
    } else {
        teamBox.appendChild(img1);
        teamBox.appendChild(matchText)
        teamBox.classList.add("left-box")
    }

    return teamBox
}

function matchScore(endResult, isFinished) {
    let endResultElement = document.createElement("b")
    if (endResult != "") {
        endResultElement.id = "end-result"
        endResultElement.appendChild(document.createTextNode(endResult))
        if (isFinished) {
            endResultElement.classList.add("finished-match")
        }
    } else {
        endResultElement.appendChild(document.createTextNode("-:-"))
        if (isFinished) {
            endResultElement.classList.add("finished-match")
        }
    }
    return endResultElement
}

function createMatchDomElement(team1Name, team2Name, result, matchLink, endResult, isBroadcast, time, status, isFinished, team1Icon, team2Icon) { // match line
    let divMatchLine = document.createElement("div");
    divMatchLine.classList.add("match_line")

    let divMatchNameLine = document.createElement("div");
    divMatchNameLine.classList.add("match_name")
    divMatchLine.appendChild(document.createTextNode(time))

    divMatchLine.appendChild(createTeamBox(team1Icon, team1Name, false))
    divMatchLine.appendChild(matchScore(endResult, isFinished))
    divMatchLine.appendChild(createTeamBox(team2Icon, team2Name, true))

    if (result != "") {
        divMatchLine.title = result
    }

    if (matchLink != null) {
        divMatchLine.id = startUrl + matchLink;
    }

    let statusElement = document.createElement("span")
    statusElement.id = "match-status"
    statusElement.classList.add("status")
    statusElement.appendChild(document.createTextNode("(" + status + ")"))
    divMatchLine.appendChild(statusElement)

    let img = document.createElement('img');
    img.id = "broadcast"
    img.width = 24;

    img.src =
        'https://static.wikia.nocookie.net/tvpedia/images/c/c9/Okko_%D0%A1%D0%BF%D0%BE%D1%80%D1%82_%282019%2C_%D1%84%D0%BE%D0%BD%29.jpg/revision/latest/scale-to-width-down/220?cb=20190609081550&path-prefix=ru';
    divMatchLine.appendChild(img);

    if (!isBroadcast) {
        img.style.visibility = "hidden";
    }
    return divMatchLine
}

function generateTournamentName(name, image, imageFlag, tournament, id) {
    let divTournamentLine = document.createElement("div");
    divTournamentLine.classList.add("tournament_line")
    if (imageFlag) {
        let imgFlag = document.createElement('img');
        imgFlag.id = "country_image"
        imgFlag.src = imageFlag;
        imgFlag.width = 24;
        divTournamentLine.appendChild(imgFlag);
    }

    let divTournir = document.createElement("H4")

    let tournirName = document.createTextNode(name);
    divTournir.appendChild(tournirName)
    divTournamentLine.appendChild(divTournir)
    let img = document.createElement('img');
    img.id = "tournament_image"
    img.src = image;
    img.width = 24;
    divTournamentLine.appendChild(img);

    let selectedTournament = tournament.find((element) => element.id == id);
    if (selectedTournament.isShowTableIcon) {
        let table = document.createElement('img');
        table.id = "table_icon"
        table.src = "https://www.svgrepo.com/show/506874/db-table.svg";
        table.width = 24;
        table.onclick = () => {
            if (selectedTournament.isShowMatches) {
                page = 2
            } else {
                page = 1
            }
            currentSlide(page, selectedTournament.id)
            selectedTournament.isShowMatches = !selectedTournament.isShowMatches

            // while (document.body.firstChild) {
            //     document.body.firstChild.remove()
            // }

            // makeCallForMatches()


        };
        divTournamentLine.appendChild(table);
    }


    return divTournamentLine
}

function generateTypeElement(nameValue) {
    let typeElement = document.createElement("H3")
    typeElement.id = "type-name"
    typeElement.appendChild(document.createTextNode(nameValue))
    return typeElement
}

