function handleHyperLink() {
    var list = document.getElementsByClassName('match_line');
    for (let link of list) {
        link.addEventListener('click', function () {
            var newURL = link.id;
            chrome.tabs.create({ url: newURL });
        });
    }
}

function makeCallForTable(link, div) {
    fetch("https://www.championat.com" + link + "table/", {
        method: "get",
        headers: {
            "X-Requested-With": "XMLHttpRequest",
            "Access-Control-Allow-Origin": "*",
        },
    }).then(data => {
        data.text().then(text => {
            const parser = new DOMParser();
            const htmlDoc = parser.parseFromString(text, 'text/html');

            elements = htmlDoc.getElementsByClassName('tabs-item');

            console.log(JSON.stringify(elements))
            fillTableData(htmlDoc, div)
        })
    }).catch(error => {

        const parser = new DOMParser();
        const htmlDoc = parser.parseFromString(testPage, 'text/html');

        fillTableData(htmlDoc, div)
    });
}

function makeCallForMatches() {
    httpGet("https://www.championat.com/stat/data/" + `${year}-${month}-${day}`).then(data => {
        let types = data[matchesKey];
        if (types != null) {
            let football = types[footballKey];
            if (DEBUG_LOG_ENABLED) {
                console.log(football);
            }

            if (football != null) {
                generateTournamentView(football)
            }

            let hockey = types[hockeyKey];
            if (DEBUG_LOG_ENABLED) {
                console.log(hockey);
            }

            if (hockey != null) {
                generateTournamentView(hockey)
            }
        }

        if (document.readyState === "loading") {
            document.addEventListener("DOMContentLoaded", handleHyperLink);
        } else {
            handleHyperLink();
        }
    });
}

function fillTableData(htmlDoc, div) {
    var dataTable = htmlDoc.getElementsByClassName("results-table");
    var titles = htmlDoc.getElementsByClassName("tournament-title")
    let tables = document.createElement("div");

    if (dataTable.length == 3) {
        letCountTables = 1
        tables.classList.add("tables")
    } else {
        letCountTables = 7//dataTable.length
    }


    var hiperlinks = htmlDoc.getElementsByTagName("a")

    var bubles = document.getElementsByClassName("results-table__zone");
    for (let buble of bubles) {
        // buble.setAttribute("onmouseover", (event) => {
        //     // isMouseHover = true
        //     // event.target.textContent = "mouse in"
        //     console.log(isMouseHover)
        // })

        buble.addEventListener("mouseleave", (event) => {
            // isMouseHover = false
            // event.target.textContent = "mouse out"
            if (buble.children.length > 0) {
                buble.children[0].classList.remove("show")
            }
        }, true);
        buble.addEventListener("mouseover", (event) => {
            // isMouseHover = true
            // event.target.textContent = "mouse in"
            if (buble.children.length > 0) {
                buble.children[0].classList.add("show")
            }
        }, false);
    }




    for (let link of hiperlinks) {
        link.removeAttribute("href")
    }

    for (var i = 0; i < letCountTables; i++) {
        let table = dataTable[i]

        if (table == undefined) {
            continue
        }

        // parse football table
        if (letCountTables == 1) {
            // remove head cell
            table.tHead.children[0].children[8].remove()

            // remove line cell
            let elements = table.tBodies[0].children
            for (let element of elements) {
                element.children[8].remove()
            }
        } else if (table != undefined && table.tHead != null) {
            // remove head cell
            if (table.tHead.children[0].children.length > 11) {
                table.tHead.children[0].children[11].remove()

                // remove line cell
                let elements = table.tBodies[0].children
                for (let element of elements) {
                    element.children[11].remove()
                }
            }
        }

        var container = document.createDocumentFragment();

        if (titles.length > i) {
            let title = titles[i]
            let typeElement = document.createElement("H3")
            typeElement.id = "type-name"
            typeElement.appendChild(document.createTextNode(title.innerHTML))
            container.appendChild(typeElement)
        }

        let tableDIV = document.createElement('table');

        tableDIV.innerHTML = table.innerHTML
        for (var j = 0; j < tableDIV.childNodes.length; j++) {
            var node = tableDIV.childNodes[j].cloneNode(true);
            container.appendChild(node);
        }

        tables.appendChild(container)

        let spaccer = document.createElement("div");
        spaccer.classList.add("spacer-repeated")

        tables.appendChild(spaccer)
    }

    div.appendChild(tables)
}

function commonDateLogic() {
    day = date.getDate();
    month = date.getMonth() + 1;
    if (month < 10) {
        month = "0" + month
    }
    if (day < 10) {
        day = "0" + day
    }
    year = date.getFullYear();

    document.getElementById("selectedDate").value = date.toISOString().substr(0, 10)

    var fc = document.body.firstChild;

    while (document.body.lastChild) {
        if (document.body.lastChild.classList != undefined && document.body.lastChild.classList.contains("date-picker")) {

        } else {
            document.body.lastChild.remove()
        }

        if (document.body.children.length == 1) {
            break;
        }
    }

    makeCallForMatches()
}

function minusDays() {
    date.setDate(date.getDate() - 1);
    commonDateLogic()
}

function plusDays() {
    date.setDate(date.getDate() + 1);
    commonDateLogic()
}

function onChangeDate() {
    date = new Date(document.getElementById("selectedDate").value)
    commonDateLogic()
}


